--## CRIACAO DA TABELA TEMPORARIA COM OS CHEQUES DO VIRTUAL
USE MIGRACAO
GO
--DROP TABLE TEMP_CHEQUE_PENDENTE
CREATE TABLE TEMP_CHEQUE_PENDENTE (
	
	COD_ALUNO_VIRTUAL VARCHAR(11)
,	NOME_ALUNO VARCHAR(100)
,	COD_CURSO VARCHAR(11)
,	TURNO VARCHAR(2)
,	COD_CURRICULO VARCHAR(11)
,	ID_CHEQUE_VIRTUAL VARCHAR(11)
,	VALOR NUMERIC(10,2)
,	PARCELA VARCHAR(11)
,	CPF_TITULAR VARCHAR(20)
,	NOME_TITULAR VARCHAR(100)
)
GO

--## INSERÇÃO DE DADOS TRAZIDOS DA CONSULTA DE LUIZ
--DELETE FROM TEMP_CHEQUE_PENDENTE

SELECT * FROM LY_ALUNO A
JOIN TEMP_CHEQUE_PENDENTE C
ON C.